import React from 'react';
import './styleList.css';

const List = () => {
    return (
        <div className='list'>
        
            <h2 className='logo'>innovationItTech</h2>
            <h2 className='horizontal-line'></h2>
            <ul  className='unordered_list'>
                <li>Կենտրոն</li>
                <li>Աջափնյակ</li>
                <li>Մալաթիա-Սեբաստիա</li>
                <li>Դավթաշեն</li>
                <li>Նոր Նորք</li>
                <li>նորք-Մարաշ</li>
                <li>Քանաքեռ-Զեյթուն</li>
                <li>Ավան</li>
                <li>Արաբկիր</li>
                <li>Շենգավիթ</li>
                <li>Էրեբունի</li>
                <li>Նուբարաշեն</li>
            </ul>
            
        </div>
    );
};

export default List;
